1.泰山币是我国公开发行的首枚世界文化和自然双遗产纪念币，随后我国还将陆续发行武夷山等纪念币。因此，泰山币的热点和生肖币一样，后期具有可持续性。此外，泰山币寓意吉祥，泰山稳，天下安,行稳致.....符合中国人的大众审美观和心理期待。所以泰山币让很多人喜爱并收藏，具有很好的沉淀基础和群众基础;
2.泰山币是我国发行的首枚异形币，其外圆内方的设计，不仅蕴含浓厚的中华优秀传统文化，而且还一-改过去纪念币圆形发行模式，其新颖的外观设计，给人以强烈的视觉冲击和审美感;
3、泰山币-改过去以枚、卷、盒发行的方式，而是以简为单位，既寓意“一筒”江山，同时若以筒为单位收藏则使其1.2亿枚发行缩量为6000万筒;<br />4、2020年，我国纪念币预约和兑换将进行改革，是纪念币发行的改革年。泰山币是我国最后-枚同一身份证可以跨省预约和兑换的纪念币，也就是说泰山币相对于以后发行的其它纪念币，其筹码更加集中，炒作空间也更大。<br />总之，泰山币是我国近年发行的流通纪念币中不可多得的优良品种，值得拥有和收藏。
